import {createStore} from 'redux';

let initalize = {
    status: false,
    sort: {
        by: 'name',
        value : 1
    }
}

let myReducer = (state = initalize, action) => {
    return state;
}

const store = createStore('Default',myReducer);

console.log(store.getState());
